import React from 'react';
import { BrowserRouter } from 'react-router-dom';
import Home from './Home';

export const MainApp = () => {
    return (
        <>
        <BrowserRouter>
                <Home /> 
        </BrowserRouter>
           
        </>
    )
}


export default MainApp;
